import { Box, Typography } from "@mui/material";

export default function Login() {
  return (
      <Container>
          <TitleContainer>

          </TitleContainer>
      <Title>Welcome to the Todo App!</Title>
      <Typography>This is where you can log in or sign up to start</Typography>
    </Container>
  );
}

const Container = styled(Box)(() => ({
  display: "flex",
  flexDirection: "column",
  alignContent: "center",
}));

const Title = styled(Typography)(() => ({
  fontSize: "2rem",
  alignSelf: "center",
  marginTop: "1rem",
}));
